import React from "react";

const stories = [
  {
    title: "The Pressure to Choose Science",
    content: (
      <>
        <p><strong>Parent:</strong> "You must take the science stream. It's the best for your future."</p>
        <p><strong>Child:</strong> "But I love arts and want to pursue it. Science doesn't interest me."</p>
        <p><strong>Parent:</strong> "Arts won't get you a good job. You need a stable career."</p>
        <p><strong>Child:</strong> "I want to be happy and follow my passion."</p>
      </>
    ),
  },
  {
    title: "Choosing Engineering Over My Dreams",
    content: (
      <>
        <p><strong>Parent:</strong> "Engineering is a respected profession. You should become an engineer."</p>
        <p><strong>Child:</strong> "I want to study music and become a musician."</p>
        <p><strong>Parent:</strong> "Music won't pay the bills. Engineering is safer."</p>
        <p><strong>Child:</strong> "I need to follow my heart to be successful."</p>
      </>
    ),
  },
  {
    title: "Denied a PC for Learning",
    content: (
      <>
        <p><strong>Child:</strong> "I need a good PC to learn coding and develop my skills."</p>
        <p><strong>Parent:</strong> "No, it will ruin your studies. You spend too much time on the computer."</p>
        <p><strong>Child:</strong> "Coding is my future career. I need the PC for education."</p>
        <p><strong>Parent:</strong> "I worry it will distract you from schoolwork."</p>
      </>
    ),
  },
  {
    title: "Mobile Phone Restrictions",
    content: (
      <>
        <p><strong>Child:</strong> "I need a smartphone to access online resources and connect with mentors."</p>
        <p><strong>Parent:</strong> "Phones are distractions. You won't focus on studies."</p>
        <p><strong>Child:</strong> "I promise to use it responsibly for learning."</p>
        <p><strong>Parent:</strong> "We will see. For now, no phone."</p>
      </>
    ),
  },
];

export default function Stories() {
  return (
    <div className="bg-gray-900 min-h-screen py-12">
      <div className="max-w-7xl mx-auto p-10 bg-gray-800 rounded-3xl shadow-2xl">
        <h1 className="text-5xl font-extrabold mb-12 text-center text-yellow-400 drop-shadow-lg">
          Real Stories: The Impact of Forced Choices
        </h1>
        <div className="space-y-12">
          {stories.map((story, index) => (
            <div
              key={index}
              className="bg-yellow-400 p-8 rounded-3xl shadow-lg text-gray-900 hover:shadow-2xl transition"
            >
              <h2 className="text-3xl font-bold mb-4">{story.title}</h2>
              <p className="text-lg leading-relaxed">{story.content}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
